import React from "react";
import continut from "./home/continuthome"

function Column() {
    return (
        <div class="col-8">
            {continut.map((item) => (
                <div class="galerie" key={item.id}>
                    <img src={item.img}></img>
                </div>
          ))}
        </div>
    );
}

export default Column;
